import React from "react";

function TimerComponent() {
  const [time, SetTime] = React.useState(5);
  console.log("업데이트");
  SetTime = time + 1;
  return (
    <div>
      <h3>{time}초</h3>
      <button onClick={SetTime}>1씩 올려주세요</button>
    </div>
  );
}

export default TimerComponent;
